import React from 'react'

class ShowFull extends React.Component{
    render(){
        return(
            <>
                <div style={{padding: '5px', width : '350px',borderRadius: '15px 15px 0 0',backgroundColor: '#00000033'}}>
                    Chung ta da ben nhau...
                </div>
                <div style={{padding: '1px', width : '350px',borderRadius: '15px 15px 0 0',backgroundColor: '#00000010'}}>
                </div>
            </>
        )
    }
}

export default ShowFull;
